import { useState } from "react"

const Tasks = () => {
    const [tasks, setTasks] = useState([
        {
            id: 1,
            text: 'Doctors Appointment',
            day: 'Feb 5th at 2:30pm',
            reminder: true
        },
        {
            id: 2,
            text: 'Court Appearance',
            day: 'Feb 15th at 3:30pm',
            reminder: true
        },
        {
            id: 3,
            text: 'Parents-Teacher meeting',
            day: 'Feb 7th at 7:30pm',
            reminder: true
        }
    ])

  return (
    <>
        {tasks.map((task)=>(
            <h5 key={task.id}>{task.text}</h5>
        ))}
    </>
  )
}

export default Tasks
